import React from 'react'

const Form = () => {
  return (
    <div>
      <form>
        <input type="text" placeholder="email"></input>
        <input type="password" placeholder="password"></input>
        <button type="submit">Login</button>
      </form>
    </div>
  )
}

export default Form;
